CREATE DATABASE IF NOT EXISTS `i2e` ;
USE `i2e`;

CREATE TABLE `tb_persona` (
 `id_persona` varchar(11) NOT NULL,
 `nombre` varchar(20) NOT NULL,
 `apellido` varchar(20) NOT NULL,
 `foto` mediumblob  DEFAULT NULL,
 `celular` varchar(11) DEFAULT NULL,
 PRIMARY KEY (`id_persona`)
);

  CREATE TABLE `tb_rol` (
  `id_rol` varchar(15) NOT NULL ,
  `nombre_rol` varchar(50) NOT NULL,
  PRIMARY KEY (`id_rol`)

  );


 CREATE TABLE `tb_inventarios` (
 `id_inventario` varchar(11) NOT NULL,
 `id_semillero` varchar(11) NOT NULL,
 `imagen` mediumblob  NOT NULL,
 `nombre_producto` varchar(20) NOT NULL,
 `referencia` varchar(50) NOT NULL,
 `descripcion` text NOT NULL,
 `datasheet` mediumblob  NOT NULL,
 PRIMARY KEY (`id_inventario`)
);


  CREATE TABLE `tb_proyectos` (
 
  id_proyecto varchar(11) NOT NULL,
  id_semillero varchar(11) NOT NULL,
  Titulo text NOT NULL,
  Resumen text NOT NULL,
  Palabras_claves text NOT NULL,
  Justificacion text NOT NULL,
  PRIMARY KEY (`id_proyecto`)
  ) ;


  CREATE TABLE `tb_semilleros` (
 `id_semillero` varchar(11) NOT NULL,
  `nombre_semillero` varchar(50) NOT NULL,
  `descripcion` text NOT NULL,
  `foto` mediumblob NOT NULL,	

  PRIMARY KEY (`id_semillero`),
  UNIQUE KEY `nombre_semillero` (`nombre_semillero`)
  );


 
  CREATE TABLE `tb_usuarios` (
 `id_usuario` varchar(11) NOT NULL,
 `id_persona` varchar(11) NOT NULL,
 `id_rol` varchar(15) NOT NULL,
 `id_semillero` varchar(11) NOT NULL,
 `correo_electronico` varchar(50) NOT NULL,
 PRIMARY KEY (`id_usuario`),
 UNIQUE KEY `correo_electronico` (`correo_electronico`)
);

CREATE TABLE `tb_contrasenas` (
 `id_contrasena` varchar(11) NOT NULL,
 `id_usuario` varchar(11) NOT NULL,
 `contrasena` varchar(50) NOT NULL,
 `contrasena_temporal` int(1),
 PRIMARY KEY (`id_contrasena`)
);

CREATE TABLE `tb_proyectosuser` (
 `id_proyectouser` varchar(10) NOT NULL,
 `id_proyecto` varchar(11) NOT NULL,
 `id_user` varchar(11) NOT NULL,
 PRIMARY KEY (`id_proyectouser`)
 );
 
 CREATE TABLE `tb_imagenes` (
 `id_img` varchar(11) NOT NULL,
 `nombre` varchar(11) NOT NULL,
 `img` mediumblob  NOT NULL,
  PRIMARY KEY (`id_img`)
  );
 
 CREATE TABLE `tb_accion` (
 `id_accion` varchar(11) NOT NULL,
 `nombre_accion` varchar(20) NOT NULL,
 PRIMARY KEY (`id_accion`)
);

CREATE TABLE `tb_modificacion` (
 `id_modificador` varchar(11) NOT NULL,
 `id_user` varchar(11) NOT NULL,
 `id_inventario` varchar(11) NOT NULL,
 `cantidad` int(11) NOT NULL,
 `id_accion` varchar(11) NOT NULL,
 `fecha_ultima_modificacion` timestamp NOT NULL DEFAULT current_timestamp(),
 
 PRIMARY KEY (`id_modificador`)
);

ALTER TABLE  tb_contrasenas ADD CONSTRAINT FK_contrasenas_usuarios FOREIGN KEY (id_usuario) REFERENCES tb_usuarios (id_usuario);

ALTER TABLE tb_proyectos ADD CONSTRAINT FK_proyectos_semilleros FOREIGN KEY (id_semillero) REFERENCES tb_semilleros(id_semillero); 

ALTER TABLE tb_usuarios ADD CONSTRAINT FK_usuarios_personas FOREIGN KEY (id_persona) REFERENCES tb_persona(id_persona);

ALTER TABLE tb_usuarios ADD CONSTRAINT FK_usuarios_roles FOREIGN KEY (id_rol) REFERENCES tb_rol(id_rol);

ALTER TABLE tb_usuarios ADD CONSTRAINT FK_usuarios_semilleros FOREIGN KEY (id_semillero) REFERENCES tb_semilleros(id_semillero);

ALTER TABLE tb_inventarios ADD CONSTRAINT FK_inventarios_semillero FOREIGN KEY (id_semillero) REFERENCES tb_semilleros(id_semillero); 
   
ALTER TABLE tb_proyectosuser ADD CONSTRAINT FK_proyectosuser_proyecto FOREIGN KEY (id_proyecto) REFERENCES tb_proyectos (id_proyecto);

ALTER TABLE tb_proyectosuser ADD CONSTRAINT FK_proyectosuser_usuarios FOREIGN KEY (id_user) REFERENCES tb_usuarios (id_usuario);

ALTER TABLE tb_modificacion ADD CONSTRAINT FK_modificacon_usuarios FOREIGN KEY (id_user) REFERENCES tb_usuarios (id_usuario);

ALTER TABLE tb_modificacion ADD CONSTRAINT FK_modificacion_inventario FOREIGN KEY (id_inventario) REFERENCES tb_inventarios (id_inventario);

ALTER TABLE tb_modificacion ADD CONSTRAINT FK_modificacion_accion FOREIGN KEY (id_accion) REFERENCES tb_accion (id_accion);

DELIMITER $$
CREATE TRIGGER `trg_id_tb_contrasenas` BEFORE INSERT ON `tb_contrasenas` FOR EACH ROW BEGIN
  DECLARE id INT;
  SET id = (SELECT MAX(CAST(SUBSTRING(id_contrasena, 4) AS UNSIGNED)) FROM tb_contrasenas);
  IF id IS NULL THEN
    SET id = 0;
  END IF;
  SET NEW.id_contrasena = CONCAT('IdC', LPAD(id + 1, 7, '0'));
END
$$
DELIMITER ;


