INSERT INTO `tb_semilleros` (`id_semillero`, `nombre_semillero`, `descripcion`, `foto`) VALUES
('si_01', 'INVESTIGACION DE ROBOTICA', 'El Semillero de Investigación en Microcontroladores y sus Aplicaciones SIMA UPTC se enfoca en el desarrollo de proyectos académicos e investigativos para contribuir a la formación integral de ingenieros electrónicos y promover el desarrollo científico, económico y social de la región. Buscan brindar un espacio para que los estudiantes pongan en práctica los conocimientos adquiridos y compartan ideas y experiencias. Su visión es ser reconocidos por la calidad de sus procesos de formación investigativa en robótica, automatización industrial y electrónica de potencia, y generar soluciones al sector productivo. Entre sus actividades se encuentran la formación en sistemas embebidos basados en microcontroladores, la creación de artículos científicos, la participación en eventos de Ciencia, Tecnología e Innovación y la formulación de proyectos con énfasis en propuestas de trabajo de grado.', );
INSERT INTO `tb_semilleros` (`id_semillero`, `nombre_semillero`, `descripcion`, `foto`) VALUES
('si_02', 'S-PERD', 'El Semillero de Investigación en Energías Alternativas y Electrónica de Potencia (S-PERD) se ha consolidado desde febrero de 2019 en sus actividades de investigación, las cuales incluyen la construcción de modelos conceptuales, metodológicos y operativos, el desarrollo y presentación de proyectos, la realización de encuentros de investigación y la participación en eventos y foros de investigación a nivel nacional e internacional. Además, el semillero se ha vinculado a macro-proyectos a nivel local, nacional e internacional y ha desarrollado un proyecto de investigación formativa que se retroalimenta con la experiencia de otros grupos de investigación.', ),
('si_03', 'INSYNTEC', 'El Semillero de investigación Instrumentation Systems for New Technologies (INSYNTEC) tiene como misión desarrollar el pensamiento crítico e investigativo del estudiante de Ingeniería Electrónica en el campo de la instrumentación biomédica e industrial mediante la generación, descripción, análisis y síntesis de proyectos. Su visión es convertirse en un referente nacional e institucional de procesos investigativos de alto nivel e impacto, y fortalecer los procesos al interior del grupo I2E de la Escuela de Ingeniería Electrónica. Entre sus actividades se encuentran la creación de espacios de trabajo adecuados, la\r\n\r\nobtención de dispositivos electrónicos para el grupo, el desarrollo de guías prácticas, la selección y tabulación de información disponible, el trabajo experimental basado en sensórica y actuadores, el desarrollo de algoritmos y sistemas instrumentales, y la investigación en sistemas industriales, robóticos, electromédicos, biónica y biomimética.', );
INSERT INTO `tb_semilleros` (`id_semillero`, `nombre_semillero`, `descripcion`, `foto`) VALUES
('si_04', 'MATRIS2', 'El Semillero de Investigación MATRIS2 fue creado en la Escuela de Ingeniería Electrónica de la UPTC en 2015, y se enfoca en la investigación experimental en procesamiento de señales análogas y digitales, así como en el análisis, modelado y diseño de sistemas electrónicos. Su misión es fomentar la cultura investigativa y propiciar el crecimiento y formación de sus integrantes para la creación de soluciones a problemas y necesidades en la región y el país. Su visión es ser un espacio académico para formar jóvenes investigadores de alto impacto social y científico en el campo de las señales y sistemas.\r\n\r\nEntre sus actividades se encuentran reuniones periódicas para planear, socializar y desarrollar propuestas de investigación, entrega de informes periódicos, desarrollo de propuestas de investigación, redacción y preparación de artículos para presentar en eventos nacionales o internacionales, participación en dichos eventos, y organización de eventos académicos para socializar la investigación con la participación de estudiantes, profesores y otros semilleros. El semillero se proyecta como un espacio de diálogo en investigación para los estudiantes de la Escuela de Ingeniería Electrónica de la UPTC, y busca crear vínculos académicos y ser reconocido en el campo de las señales y sistemas.', );
INSERT INTO `tb_semilleros` (`id_semillero`, `nombre_semillero`, `descripcion`, `foto`) VALUES
('si_05', 'TELECOMUNICACIONES', 'El Semillero de Investigación en Telecomunicaciones tiene como misión fomentar y apoyar procesos de investigación en el área de telecomunicaciones mediante la generación de propuestas de proyectos que solucionen necesidades y problemáticas de la sociedad, y así mejorar los procesos de investigación en el área. Entre sus actividades se encuentran\r\n\r\ndefinir criterios de participación en comunidades científicas y académicas, realizar estudios sistemáticos, apoyar el desarrollo de procesos de investigación en estudiantes y desarrollar proyectos de investigación para dar solución a necesidades y problemáticas de la comunidad.', ),
('si_null', 'NO APLICA', '', '');


